import React from "react";
import "./Calendar.scss";

export const Calendar = () => {
  const dayNames = ["MON", "TUE", "WED", "THU", "FRI", "SAT", "SUN"];

  return (
    <div className="calendar mx-10">
      {dayNames.map((name, index) => (
        <h1 key={index} className="text-3xl">
          {name}
        </h1>
      ))}
    </div>
  );
};
